// src/components/Navbar.js
import React from 'react';

function Navbar() {
    return (
        <div className="navbar">
            <div className="nav-item">Main</div>
            <div className="nav-item">Employees</div>
            <div className="nav-item">My Profile</div>
        </div>
    );
}

export default Navbar;
